import React, { useState } from "react";
// import { Link, useNavigate } from "react-router-dom";

const Register = () => {
  const [formValue, setFormValue] = useState({
    username: "",
    password: "",
  });

// const navigate = useNavigate();
//const handleChange
const handleSubmit = (e) => {
  e.preventDefault();
};

return (
  <div className="register">
    <p className="register__name">Регистрация</p>
    <form className="register__form popup__form" onSubmit={handleSubmit}>
      <div className="register__input popup__input">
        <input
          id="email"
          type="email"
          name="email"
          placeholder="https://somewebsite.com/someimage.jpg"
          className="register__info popup__info"
          minLength="2"
          maxLength="40"
          required=""
        />
        <span className="ava-link-input-error popup__info-error">
          Необходимо ввести вашу почту
        </span>
        <input
          id="password"
          type="password"
          name="password"
          placeholder="https://somewebsite.com/someimage.jpg"
          className="register__info popup__info"
          minLength="6"
          maxLength="40"
          required=""
        />
        <span className="ava-link-input-error popup__info-error">
          Необходимо ввести правильный пароль
        </span>
      </div>
      <button className="register__save" type="submit">
        Зарегистрироваться
      </button>
    </form>
    <div className="register__signin">
      <p>Уже зарегистрированы?</p>
      {/* <Link to="login" className="register__login-link">
        Войти
      </Link> */}
    </div>
  </div>
);
}
export default Register;
